  return (
      <div>
          <Layout>
            <div className="listado-productos">
                <div className="contenedor">
                    <ul className="bg-white">
                        {productos.map(producto => (
                           <Productos
                              key={producto.id}
                              producto={producto}
                           />
                        ))}
                    </ul>
                </div>
            </div>
          </Layout>
      </div>
  )
}

export default Home;
